 "Correct Location (y)": "Do\u011fru Konum (y)", 
 "<p>Enter the text for the cloze activity in to the cloze field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to hide, double click on the word to select it and \nclick on the Hide\/Show Word button below.<\/p><p>More than one possible answer can be defined enclosing them with pipes (|). I.e.: |dog|cat|bird|<\/p>": "<p>Bo\u015fluklar\u0131 dorldurma etkinli\u011fi i\u00e7in metni, ba\u015fka bir kaynaktan metin yap\u0131\u015ft\u0131rarak veya do\u011frudan alana yazarak, doldurma alan\u0131na girin.<\/p> <p>Gizlenecek kelimeleri se\u00e7mek i\u00e7in kelimeye \u00e7ift t\u0131klayarak se\u00e7in ve A\u015fa\u011f\u0131daki Kelimeyi Gizle\/G\u00f6ster d\u00fc\u011fmesine t\u0131klay\u0131n.<\/p> <p>Birden fazla olas\u0131 cevap, bunlar\u0131 ba\u011flant\u0131lar (|) ile \u00e7evreleyerek tan\u0131mlanabilir. Yani: |k\u00f6pek|kedi|ku\u015f|<\/p>", 
