 "Provide a caption for the image \nyou have just inserted.": "Yeni ekledi\u011finiz resim i\u00e7in bir ba\u015fl\u0131k ekleyin.", 
 "Checking this option, a \"Page X of Y.\" text will be added to every page of the exported content (except ePub's frontpage). This doesn't affect Single Page and Text File export files.": "Bu se\u00e7enek i\u015faretlendi\u011finde, bir \"Sayfa X of Y.\" d\u0131\u015fa aktar\u0131lan i\u00e7eri\u011fin her sayfas\u0131na metin eklenecektir (ePub'\u0131n \u00f6n sayfas\u0131 hari\u00e7). Bu, Tek Sayfa ve Metin Dosyas\u0131 d\u0131\u015fa aktarma dosyalar\u0131n\u0131 etkilemez.", 
