 "Use the $ option after recording to define the authorship or the audio title.": "Yazarl\u0131\u011f\u0131 veya ses ba\u015fl\u0131\u011f\u0131n\u0131 tan\u0131mlamak i\u00e7in kay\u0131ttan sonra $ se\u00e7ene\u011fini kullan\u0131n.", 
 "%prog, the commandline version of eXe.\nUsage: %prog [options] input_file [output_file]\n\nTo show help:\n%prog -h": "%p prog, eXe'nin komut sat\u0131r\u0131 s\u00fcr\u00fcm\u00fc. Kullan\u0131m: %p prog [se\u00e7enekler] input_file [output_file] Yard\u0131m\u0131 g\u00f6stermek i\u00e7in: %prog -h", 
 "SCORM Options (1.2 and 2004)": "SCORM Se\u00e7enekleri (1.2 ve 2004)", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Choose words in the text that are key to understanding the concepts. These will probably be verbs, nouns, and key adverbs. Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl> <dt>Amac\u0131n\u0131z temel kavramlar\u0131 anlay\u0131p anlamad\u0131\u011f\u0131n\u0131z\u0131 veya okudu\u011funu anlay\u0131p anlamad\u0131\u011f\u0131n\u0131z\u0131 test etmekse <\/dt><dd><p>Kavram\u0131n bir \u00f6zetini yaz\u0131n veya hedefin bilgisini yeterince test edecek kadar uzun, ancak yorgunlu\u011fa neden olmayacak kadar k\u0131sa bir okuma yap\u0131n. Birden az sayfa muhtemelen yeterlidir, ancak muhtemelen gen\u00e7 \u00f6\u011frenciler veya yeni ba\u015flayanlar i\u00e7in \u00f6nemli \u00f6l\u00e7\u00fcde daha azd\u0131r. <\/p><p>Kavramlar\u0131 anlaman\u0131n anahtar\u0131 olan metindeki kelimeleri se\u00e7in. Bunlar muhtemelen fiiller, isimler ve anahtar zarflar olacakt\u0131r. Tek bir net cevapla alternatifleri se\u00e7in. <\/p><\/dd><dt>Amac\u0131n\u0131z kelime bilgisini test etmekse<\/dt><dt> Amac\u0131n\u0131z kelime olu\u015fumunu\/gramerini test etmekse: <\/dt><dd><p>Hedef formlar\u0131 kullanarak bir metin yaz\u0131n. Bu metin tutarl\u0131 ve tutarl\u0131 olmal\u0131 ve uygun uzunlukta olmal\u0131d\u0131r. Hedefin kelime bilgisi olmad\u0131\u011f\u0131n\u0131 unutmay\u0131n, bu nedenle k\u00f6k kelimelerin temel anlamlar\u0131 \u00f6\u011frenciler taraf\u0131ndan iyi bilinmelidir. <\/p><p>Metindeki hedef kelimeleri vurgulay\u0131n. Ayn\u0131 kelime k\u00f6k\u00fcne sahip, ancak farkl\u0131 eklere sahip alternatifler sa\u011flay\u0131n. S\u00fcrpriz olmad\u0131\u011f\u0131ndan emin olmak i\u00e7in testi\/egzersizi test etmesi i\u00e7in bir meslekta\u015f\u0131n\u0131z\u0131n olmas\u0131 iyi bir fikirdir! <\/p><\/dd><\/dl>", 
