 "Provide instruction on how the cloze activity should be \ncompleted. Default text will be entered if there are no changes to this field.\n": "Bu alanda Bo\u015fluklar\u0131 doldurma al\u0131\u015ft\u0131rmas\u0131n\u0131n nas\u0131l tamamlanmas\u0131 gerekti\u011fi hakk\u0131nda \nbilgi verin. E\u011fer de\u011fi\u015fiklik yap\u0131lmazsa \u00f6ntan\u0131ml\u0131 yaz\u0131 sunulacakt\u0131r.\n", 
