 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>DropDown al\u0131\u015ft\u0131rmalar\u0131, \u00f6\u011frencilerin do\u011fru kelimeleri se\u00e7mesi gereken metinler veya c\u00fcmlelerdir.<\/p><ol><li> Genellikle a\u015fa\u011f\u0131daki ama\u00e7lar i\u00e7in kullan\u0131l\u0131rlar\\<\/li><li>Temel kurs kavramlar\u0131 hakk\u0131ndaki bilgileri kontrol etmek i\u00e7in (bu bir \u00f6n kontrol, bi\u00e7imlendirici al\u0131\u015ft\u0131rma veya \u00f6zetleyici kontrol olabilir).<\/li><li>Okudu\u011funu anlamay\u0131 kontrol etmek i\u00e7in.Kelime bilgisini kontrol etmek i\u00e7in.<\/li><<li>Kelime olu\u015fumunu ve\/veya dil bilgisi yeterlili\u011fini kontrol etmek i\u00e7in. <\/li><\/ol>", 
