 "Add all the files provided for the applet\nexcept the .txt file one at a time using the add files and upload buttons. The \nfiles, once loaded will be displayed beneath the Applet code field.": "Dosya ekle ve y\u00fckle d\u00fc\u011fmelerini kullanarak, .txt dosyas\u0131 d\u0131\u015f\u0131nda uygulama i\u00e7in sa\u011flanan t\u00fcm dosyalar\u0131 tek tek ekleyin. Y\u00fcklendikten sonra dosyalar, Uygulama kodu alan\u0131n\u0131n alt\u0131nda g\u00f6r\u00fcnt\u00fclenir.", 
 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU Free Documentation 1.2 License, and since 2009 additionally\nby the Creative Commons Attribution-ShareAlike 3.0 Unported License.<\/p>": "<p>Wikipedia iDevice, Wikipedia'daki mevcut i\u00e7eri\u011fi bulman\u0131z\u0131 ve bu i\u00e7eri\u011fi exe kayna\u011f\u0131n\u0131za indirmenizi sa\u011flar. Wikipedia makalesi iDevice makale i\u00e7eri\u011finin anl\u0131k bir kopyas\u0131n\u0131 al\u0131r. Wikipedia'daki de\u011fi\u015fiklikler tek tek anl\u0131k g\u00f6r\u00fcnt\u00fc kopyalar\u0131n\u0131 exe'de otomatik olarak g\u00fcncelle\u015ftirmez, makalenin yeni bir kopyas\u0131n\u0131n al\u0131nmas\u0131 gerekir. Ayn\u0131 \u015fekilde, exe'de yap\u0131lan de\u011fi\u015fiklikler de Wikipedia'da g\u00fcncellenmeyecektir.<\/p>\n\n<p>Wikipedia i\u00e7eri\u011fi GNU \u00fccretsiz Belgeleme 1.2 Lisans\u0131 kapsam\u0131ndad\u0131r ve 2009 y\u0131l\u0131ndan bu yana Creative Commons Attribution - ShareAlike 3.0 K\u0131s\u0131tlamam\u0131\u015f Lisans\u0131 kapsam\u0131ndad\u0131r.<\/p>", 
