 "<p>The reading activity, as the name\nsuggests, should ask the learner to perform some form of activity. This activity\nshould be directly related to the text the learner has been asked to read.\nFeedback to the activity where appropriate, can provide the learner with some\nreflective guidance.<\/p>": "<p>Okuma etkinli\u011fi, ad\u0131ndan da anla\u015f\u0131laca\u011f\u0131 gibi, \n\u00f6\u011frenciden bir t\u00fcr etkinlik ger\u00e7ekle\u015ftirmesini istemelidir. Bu aktivite, \u00f6\u011frencinin okumas\u0131 istenen metinle do\u011frudan ilgili olmal\u0131d\u0131r. Uygun oldu\u011funda aktiviteye geri bildirim, \u00f6\u011frenciye baz\u0131 \nyans\u0131t\u0131c\u0131 rehberlik sa\u011flayabilir.<\/p>", 
