 "Include Single Page export file?": "Tek sayfa olarak d\u0131\u015far\u0131 aktarmada dosya dahil edilsin mi?", 
 "<p>Teachers should keep the following in mind when using this iDevice: <\/p><ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p>\u00d6\u011fretmenler bu iCihaz\u0131 kullan\u0131rken a\u015fa\u011f\u0131dakileri ak\u0131llar\u0131nda tutmal\u0131d\u0131r <\/p><ol><li>Kayna\u011f\u0131n\u0131z i\u00e7in planlanan ve i\u00e7erikte g\u00f6rsel olarak i\u015faret edilecek farkl\u0131 etkinlik t\u00fcrlerinin say\u0131s\u0131n\u0131 d\u00fc\u015f\u00fcn\u00fcn. \u00c7ok fazla farkl\u0131 faaliyet t\u00fcr\u00fc veya s\u0131n\u0131fland\u0131rmas\u0131 kullanmaktan ka\u00e7\u0131n\u0131n, aksi takdirde \u00f6\u011frencinin kafas\u0131 kar\u0131\u015fabilir. Genellikle \u00fc\u00e7 veya d\u00f6rt farkl\u0131 t\u00fcr bir \u00f6\u011fretim kayna\u011f\u0131 i\u00e7in fazlas\u0131yla yeterlidir.<\/li><li>G\u00f6rsel tasar\u0131m a\u00e7\u0131s\u0131ndan, aralar\u0131nda herhangi bir metin olmadan birbirini hemen takip eden iki iDevice kullanmaktan ka\u00e7\u0131n\u0131n. E\u011fer bu gerekliyse, iki soru veya etkinli\u011fi tek bir iDevice'e s\u0131\u011fd\u0131r\u0131n <\/li><li>Etkinli\u011fi yapman\u0131n alg\u0131lanan faydas\u0131n\u0131n, etkinli\u011fi tamamlamak i\u00e7in harcanacak zaman ve \u00e7abadan daha a\u011f\u0131r bast\u0131\u011f\u0131 etkinlikleri d\u00fc\u015f\u00fcn\u00fcn <\/li><\/ol>", 
