 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p> iDevice metinli g\u00f6r\u00fcnt\u00fc, eXe i\u00e7eri\u011finin hem duygusal (duygusal) hem de \u00f6\u011frenme g\u00f6revi (bili\u015fsel) boyutlar\u0131n\u0131 desteklemek i\u00e7in \u00e7e\u015fitli \u015fekillerde kullan\u0131labilir. <\/p><p><b>G\u00f6rselleri s\u00f6zl\u00fc \u00f6zetlerle b\u00fct\u00fcnle\u015ftirmek.<\/b><\/p><p> Bili\u015fsel psikologlar, \u00f6\u011frencilere temsili bir g\u00f6r\u00fcnt\u00fc ve buna kar\u015f\u0131l\u0131k gelen s\u00f6zl\u00fc \u00f6zet (ayn\u0131 anda sunulur) sunman\u0131n bili\u015fsel y\u00fck\u00fc azaltabilece\u011fini belirtir. ve \u00f6\u011frenmenin kal\u0131c\u0131l\u0131\u011f\u0131n\u0131 art\u0131rmak. Bu iDevice, g\u00f6r\u00fcnt\u00fcyle ilgili ana noktalar\u0131 kapsayan k\u0131sa bir s\u00f6zl\u00fc \u00f6zet i\u00e7eren bir g\u00f6r\u00fcnt\u00fcy\u00fc (foto\u011fraf, diyagram veya grafik) sunmak i\u00e7in kullan\u0131labilir. \u00d6rne\u011fin, d\u00f6rt zamanl\u0131 bir yanmal\u0131 motorun fonksiyonlar\u0131n\u0131 \u00f6\u011fretiyor olsayd\u0131n\u0131z, pistonun d\u00f6rt konumunun her biri i\u00e7in her g\u00f6rselin temel y\u00f6nlerinin k\u0131sa bir metin \u00f6zetini i\u00e7eren bir g\u00f6rseliniz olabilir. <\/p>>", 
