 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Bo\u015fluk doldurma al\u0131\u015ft\u0131rmalar\u0131, \u00f6\u011frencilerin eksik kelimeleri doldurmalar\u0131 gereken metinler veya c\u00fcmlelerdir. Genellikle a\u015fa\u011f\u0131daki ama\u00e7lar i\u00e7in kullan\u0131l\u0131rlar:<\/p><ol><li>Temel ders kavramlar\u0131na ili\u015fkin bilgiyi kontrol etmek (bu bir \u00f6n kontrol, bi\u00e7imlendirici al\u0131\u015ft\u0131rma veya \u00f6zetleyici kontrol olabilir).<\/li><li>Okudu\u011funu anlamay\u0131 kontrol etmek i\u00e7in.<\/li><li>Kelime bilgisini kontrol etmek i\u00e7in.<\/li><li>Kelime olu\u015fturma ve\/veya gramer yeterlili\u011fini kontrol etmek <\/li><\/ol>", 
