 "Typically, Subject will be expressed as keywords, key phrases or classification codes that describe a topic of the resource. Recommended best practice is to select a value from a controlled vocabulary or formal classification scheme.": "Genellikle konu, kayna\u011f\u0131n bir konusunu a\u00e7\u0131klayan anahtar kelimeler, anahtar kelimeler veya s\u0131n\u0131fland\u0131rma kodlar\u0131 olarak ifade edilir. \u00d6nerilen en iyi uygulama, kontroll\u00fc kelime da\u011farc\u0131\u011f\u0131 veya resmi s\u0131n\u0131fland\u0131rma \u015femas\u0131ndan bir de\u011fer se\u00e7mektir.", 
