 "multi-os": "\u00e7okul-i\u015fletim sistemi", 
 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>    What educational points are conveyed in the story<\/li>\n<li>    What preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>    Where the case study fits into the rest of the course<\/li>\n<li>    How the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Vaka analizi \u00f6\u011frenilenlere e\u011fitim tabanl\u0131 bir sim\u00fclasyon sa\u011flayan bir ara\u00e7d\u0131r. Genellikle ger\u00e7ekli\u011fe dayal\u0131 bir durum gerektirir ve \u00f6\u011frenenlerin bir g\u00f6revi tamamlamak veya bir durumu \u00e7\u00f6zmek i\u00e7in ne yapacaklar\u0131n\u0131 g\u00f6stermeleri veya a\u00e7\u0131klanmas\u0131 istenir. Vaka analizi, kat\u0131l\u0131mc\u0131lar\u0131n atanan g\u00f6revleri tamamlamak i\u00e7in kendi bilgilerini ve deneyimlerini uygulayabilmelerini sa\u011flar.\nbir vaka \u00e7al\u0131\u015fmas\u0131 tasarlarken a\u015fa\u011f\u0131dakileri g\u00f6z \u00f6n\u00fcnde bulundurun:<ul> \n<li>\tHikayede hangi e\u011fitsel noktalar aktar\u0131l\u0131yor?<\/li>\n<li>\t\u00d6\u011frencilerin \u00e7al\u0131\u015fma \u00f6ncesinde ne gibi haz\u0131rl\u0131klar yapmas\u0131 gerekecek? \nVaka \u00e7aI\u0131\u015fmas\u0131 <\/li>\n<li>\tVaka \u00e7al\u0131\u015fmas\u0131n\u0131n kursun geri kalan\u0131yla uyumu<\/li>\n<li>\t\u00d6\u011frencilerin materyallerle ve birbirleriyle nas\u0131l etkile\u015fime girece\u011fi, \u00f6rn.s\u0131n\u0131f ortam\u0131nda y\u00fcr\u00fct\u00fcl\u00fcrse farkl\u0131 y\u00f6nler \u00fczerinde \u00e7al\u0131\u015fmak i\u00e7in ekipler kurulabilir mi ve e\u011fer \u00f6yleyse fikirler s\u0131n\u0131fa nas\u0131l geri besleniyor?<\/li><\/ul>", 
